VALUES ('3596710468591', 'Fish & chips', 'Filets de colin d\'Alaska MSC* (poisson) (Theragra chalcogramma, pêché en océan Pacifique) 55%, farine de blé enrichie (farine de blé, carbonate de calcium, fer, niacine, thiamine), huiles végétales (tournesol, colza), farine de blé, farine de maïs, sel, dextrose ; poudres à lever : diphosphates disodique, carbonate acide de sodium ; amidon de blé, eau, gluten de blé. Traces éventuelles de moutarde, sésame et lait. &quot;Qualité sans arête : bien qu\'un soin tout particulier ait été pris pour enlever toutes les arêtes, quelques-unes peuvent exceptionnellement se retrouver dans ce produit. MSC ce produit provient d\'une pêcherie qui a répondu au référentiel environnemental du Marine Stewardship Council pour une pêche durable et bien gérée. www.msc.org/fr', 'https://static.openfoodfacts.org/images/products/359/671/046/8591/front_fr.6.400.jpg', '9', '0.8', '17', '3.2', '0.6', '9.9', '0.64', '0.251968503937008', '', '1');

