INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3597610240386', 'SURFA\'SAFE', 'Mousse pour la désinfection et le nettoyage des surfaces et des di invasifs. (stéthoscopes, capteurs de pression, testeurs de glycémie,...) aces pouvant entrer en contact avec les denrées alimentaires. N: Chlorure de didécyldiméthylammonium (N°CAS 7173-51-5 1,4 e de polyhexaméthylène biguanide (N° CAS 27083-27-8:0,96 mg/g), excipier S MICROBIOLOGIQUES: Solution prête à l\'emploi. Bactéricide en 2 min, 20° EN 13727, EN 13697). Actif sur SARM en 2 min, 20°C (EN 13697). Ac rium tuberculosis (BK) en 15 min, 20°C. Levuricide en 5 min, 20°C (EN 1275, EN 13697). Fongicide en 20 min, 20°C (EN 1275, EN 13624, EN 13697). Actif en IV-1, BVDV (virus modèle HCV), PRV (virus modèle HBV), Vaccinia virus, Rota us, et VRS. Actif en 2 min, 20°C, sur Influenza virus A [H1N1]. EMPLOI: S\'utilise sans dilution. Appliquer la mousse détergente désinfectante propre et sec. Appliquer en quantité suffisante (6ml/m2, soit enviro ations). Bien répartir le produit sur la surface à traiter. Respecter le temps de co pour l\'activité antimicrobienne recherchée. Le rinçage est inutile sauf si les zon sont destinées à être en contact avec la peau, les muqueuses ou les den aires Róni nire nu se référer au plan d\'hyg', 'https://static.openfoodfacts.org/images/products/359/761/024/0386/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

